CEGAH AKSI COPET, PERSONEL POLRI KP3 DAN KSOP TINGKATKAN PENGAMANAN KAPAL KM DOROLONDA DI PELABUHAN PANTOLOAN PALU.

Polresta Palu,  ‚Äî Antisipasi terhadap potensi aksi kriminalitas seperti pencopetan di area pelabuhan kembali menjadi prioritas. Personel Kepolisian dari Polsek Kawasan Pelabuhan Pantoloan bersama petugas Kesyahbandaran dan Otoritas Pelabuhan (KSOP) melakukan giat pengamanan secara ketat saat kapal penumpang KM Dorolonda bersandar di Pelabuhan Pantoloan, Kota Palu, pada Minggu (13/07/2025).

Dipimpin langsung oleh Kapolsek Kawasan Pelabuhan Pantoloan, Ipda Farid, S.Ap, pengamanan menyasar seluruh aktivitas kedatangan dan keberangkatan penumpang kapal yang diketahui berasal dari Pelabuhan Balikpapan dan akan melanjutkan pelayaran menuju Pelabuhan Bitung.

Giat pengamanan dilakukan melalui pemeriksaan menyeluruh terhadap penumpang, baik yang turun maupun naik ke atas kapal. Pemeriksaan tak hanya difokuskan pada identitas penumpang, namun juga menyasar barang bawaan yang dicurigai berpotensi membahayakan keamanan bersama.

"Personel kami bersama petugas KSOP secara bersama-sama melakukan pemeriksaan barang bawaan. Sasaran utamanya adalah senjata tajam (sajam), bahan peledak (handak), narkotika, minuman keras (miras), dan kelengkapan surat-surat penumpang. Ini semua demi mencegah potensi tindak kejahatan, termasuk pencopetan yang kerap terjadi di area padat seperti pelabuhan," tegas Ipda Farid.

Selain itu, pengamanan di area dermaga juga turut diperketat. Personel disiagakan untuk memantau pergerakan penumpang serta memastikan tidak ada aktivitas mencurigakan.

‚ÄúKami ingin memberikan rasa aman dan nyaman kepada masyarakat yang menggunakan jasa transportasi laut, apalagi kapal-kapal besar seperti KM Dorolonda ini membawa ribuan penumpang dalam sekali pelayaran,‚Äù tambahnya.

Pengamanan kapal di pelabuhan bukan hanya tugas seremonial, tapi menjadi wajah keseriusan aparat dalam memastikan kawasan pelabuhan bebas dari potensi gangguan keamanan dan tindakan kriminal lainnya. Dengan sinergi Polri dan KSOP, pengawasan di Pelabuhan Pantoloan diharapkan semakin maksimal dan responsif terhadap situasi di lapangan.
